import SignUp from '../Pages/SignUp';
import SignUpEmployer from '../Pages/SignUpEmployer';
import Index from '../Pages/Index';
import Verify from '../Pages/Verify';
import Partner from '../Pages/Partner';
import PartnerLanding from '../Pages/PartnerLanding';
import Opportunity from '../Pages/Opportunity';
import OpportunityLanding from '../Pages/OpportunityLanding';
import BasicInfo from '../Pages/BasicInfo';
import Settings from '../Pages/Settings';
import AboutUs from '../Pages/AboutUs';
import PrivacyPolicy from '../Pages/PrivacyPolicy';
import TermOfUse from '../Pages/TermOfUse';
import Test from '../Pages/Test';
import Editor from '../Pages/Editor';


const Routes = [
    { path: "/", name: "home", component: Index},
    { path: "/signup", name: "signup", component: SignUp},
    { path: "/signup-employer", name: "signup-employer", component: SignUpEmployer},
    { path: "/index", name: "index", component: Index},
    { path: "/verify/:token", name: "verify", component: Verify},
    { path: "/partner", name: "partner", component: Partner},
    { path: "/partner/:companyname", name: "partnerlanding", component: PartnerLanding},
    { path: "/opportunity", name: "opportunity", component: Opportunity},
    { path: "/opportunity/:company/:jobtitle/:oppoID", name: "opportunitylanding", component: OpportunityLanding},
    { path: "/basicinfo", name: "basicinfo", component: BasicInfo},
    { path: "/settings", name: "settings", component: Settings},
    { path: "/aboutus", name: "aboutus", component: AboutUs},
    { path: "/privacypolicy", name: "privacypolicy", component: PrivacyPolicy},
    { path: "/termofuse", name: "termofuse", component: TermOfUse},
    { path: "/test", name: "test", component: Test},
    { path: "/editor", name: "editor", component: Editor},
];

export default Routes;
